import React from 'react';
import './App.scss';

import Sidebar from './components/Sidebar/Sidebar';
import Board from './components/Board/Board';
import DragDropComponent from './components/DragDropComponent/DragDropComponent';
import Panel from './components/Panel/Panel';
import Task from './components/Task/Task';

let todoTasks: Array<JSX.Element> = [];
let inprogressTasks: Array<JSX.Element> = [];

const App: React.FC = () => {

  todoTasks.push(<Task 
      taskCategory="TD"
      taskName="TD 0"
      taskDate="03-09-2019"
      taskStatus="Active"
  />);

  todoTasks.push(<Task 
      taskCategory="TD"
      taskName="TD 1"
      taskDate="03-10-2019"
      taskStatus="Active"
  />);

  inprogressTasks.push(<Task 
      taskCategory="IP"
      taskName="IP 0"
      taskDate="03-10-2019"
      taskStatus="Active"
  />);

  inprogressTasks.push(<Task 
      taskCategory="IP"
      taskName="IP 1"
      taskDate="03-10-2019"
      taskStatus="Active"
  />);

  inprogressTasks.push(<Task 
      taskCategory="IP"
      taskName="IP 2"
      taskDate="03-10-2019"
      taskStatus="Active"
  />);

  return (
    <div className="app">
      {/*<Sidebar /> 
      <Board 
        boardName="Board 1"
        boardDueDate="01-10-2019"
      />
      <DragDropComponent />*/}
      <Panel 
        tasksList={todoTasks}
        panelTitle="TODO"
        panelQuantity={10}
      />
      <Panel 
        tasksList={inprogressTasks}
        panelTitle="IN PROGRESS"
        panelQuantity={10}
      />
    </div>
  );
}

export default App;
